import Note from "./Note"

const notes = ({notes, columnId}) => {


    return (
      <>
        {columnId % 16 === 0 ?
          <div className="column">
            notes.map((note) => (
              <Note note={note} columnId={columnId} />
            ))
          </div>
        : notes.map((note) => (
          <>
            <p>test</p>
            <Note note={note} columnId={columnId}/>
          </>
          ))
        }
      </>
    )
}

export default notes
